import { useEffect } from 'react';

function UseBroom() {
	useEffect(() => {
		const script = document.getElementById('bugsOnTheLoose');
		if (script) {
			document.head.removeChild(script);
			document.querySelectorAll('.bug').forEach((bug) => {
				bug.remove();
			});
		}
	}, []);

	return null;
}

export default UseBroom;
